import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import Search from './Search'

class App extends Component {
  constructor() {
    super()
    this.state = {
      searchResults: [{
        title: ''
      }]
    }
  }

  updateSearch = (event) => {
    fetch('https://cors-anywhere.herokuapp.com/http://libgen.io/json.php?lg_topic=libgen&ids=1,6,800')
    .then((response) => response.json())
    .then((data) => {
      this.setState({
        searchResults: data
      })
      console.log(data)
    })
  }


  render() {
    return (
      <div className="App">
        <Search updateSearch={this.updateSearch}/>
        <p>'hi'{this.state.searchResults[1].title}</p>
      </div>
    );
  }
}

export default App;
